// ===== HELPER FUNCTIONS =====

/**
 * Get all Pokemon from a specific generation
 * @param {number} generation - Generation number (1-9)
 * @returns {Array} Array of Pokemon objects for the specified generation
 */
function getPokemonByGeneration(generation) {
    if (generation < 1 || generation > 9) {
        throw new Error('Generation must be between 1 and 9');
    }
    return POKEMON_BY_GENERATION[generation] || [];
}

/**
 * Get a Pokemon by its National Pokedex ID
 * @param {number} id - Pokemon ID (1-1025)
 * @returns {Object|null} Pokemon object or null if not found
 */
function getPokemonById(id) {
    return ALL_POKEMON.find(pokemon => pokemon.id === id) || null;
}

/**
 * Get Pokemon by name (case-insensitive)
 * @param {string} name - Pokemon name
 * @returns {Object|null} Pokemon object or null if not found
 */
function getPokemonByName(name) {
    const searchName = name.toLowerCase().trim();
    return ALL_POKEMON.find(pokemon => pokemon.name.toLowerCase() === searchName) || null;
}

/**
 * Get all Pokemon of a specific type
 * @param {string} type - Pokemon type (e.g., 'fire', 'water', 'grass')
 * @returns {Array} Array of Pokemon objects with the specified type
 */
function getPokemonByType(type) {
    const searchType = type.toLowerCase().trim();
    return ALL_POKEMON.filter(pokemon => 
        pokemon.types.some(pokemonType => pokemonType.toLowerCase() === searchType)
    );
}

/**
 * Get all Pokemon (returns a copy to prevent modification)
 * @returns {Array} Array of all Pokemon objects
 */
function getAllPokemon() {
    return [...ALL_POKEMON];
}

/**
 * Search Pokemon by partial name match
 * @param {string} query - Search query
 * @returns {Array} Array of Pokemon objects with names containing the query
 */
function searchPokemon(query) {
    const searchQuery = query.toLowerCase().trim();
    return ALL_POKEMON.filter(pokemon => 
        pokemon.name.toLowerCase().includes(searchQuery)
    );
}

/**
 * Get Pokemon within a specific ID range
 * @param {number} startId - Starting ID (inclusive)
 * @param {number} endId - Ending ID (inclusive)
 * @returns {Array} Array of Pokemon objects within the specified range
 */
function getPokemonByIdRange(startId, endId) {
    return ALL_POKEMON.filter(pokemon => 
        pokemon.id >= startId && pokemon.id <= endId
    );
}

/**
 * Get generation information
 * @returns {Object} Object containing generation metadata
 */
function getGenerationInfo() {
    const info = {};
    for (let gen = 1; gen <= 9; gen++) {
        const pokemon = POKEMON_BY_GENERATION[gen];
        if (pokemon && pokemon.length > 0) {
            info[gen] = {
                count: pokemon.length,
                firstId: pokemon[0].id,
                lastId: pokemon[pokemon.length - 1].id,
                firstPokemon: pokemon[0].name,
                lastPokemon: pokemon[pokemon.length - 1].name
            };
        }
    }
    return info;
}

// ===== EXPORTS =====

// Export for Node.js environments
if (typeof module !== 'undefined' && module.exports) {
    module.exports = {
        POKEMON_BY_GENERATION,
        ALL_POKEMON,
        getPokemonByGeneration,
        getPokemonById,
        getPokemonByName,
        getPokemonByType,
        getAllPokemon,
        searchPokemon,
        getPokemonByIdRange,
        getGenerationInfo
    };
}

// For browser environments, attach to window object
if (typeof window !== 'undefined') {
    window.PokemonDB = {
        POKEMON_BY_GENERATION,
        ALL_POKEMON,
        getPokemonByGeneration,
        getPokemonById,
        getPokemonByName,
        getPokemonByType,
        getAllPokemon,
        searchPokemon,
        getPokemonByIdRange,
        getGenerationInfo
    };
}
